import React from "react";
import "./Nav.css";

const Nav = () => (
  <nav className="navbar navbar-dark bg-dark navbar-top">
    <div className="container-fluid">
      <div className="navbar-header">
        <a href="/" className="navbar-brand">
          React Recipes
        </a>
      </div>
    </div>
  </nav>
);

export default Nav;
